import React from 'react';

export default function librarysong({sendingprop1}) {
    return (
        <div className="library-song">
        <img src = {sendingprop1.cover}/>
        <h3>{sendingprop1.name}</h3>
        <h4>{sendingprop1.artist}</h4>
      </div>
    )
}
